function downloadGpsData(b){let mydata="";if(b.format==="gpx"){mydata=togpx(JSON.parse(b.data))}else{if(b.format==="kml"){mydata=tokml(JSON.parse(b.data))}}const c="application/xml;charset=utf-8,"+encodeURIComponent(mydata);const a=document.createElement("a");a.setAttribute("href","data:"+c);a.setAttribute("download",b.fileName+"."+b.format);a.style.display="none";a.click()};